import Clock from 'react-live-clock';

export default function Dashboard(){
    return(
        <div id="render-item">
            <Clock format={'HH:mm:ss'} ticking={true} timezone={'VN'} date={''} />
            <br></br>
            {/* <Clock format={'dddd, MMMM Do YYYY'} ticking={true} timezone={'VN'} date={''} /> */}
       
        </div>
    )
}
